import logo from './img/Azakana_logo.png';
import './App.css';

function App() {
  return (
    <Container>
      <Navbar expand="lg" variant="light" bg="light">
        <Navbar.Brand href="#">Navbar</Navbar.Brand>
      </Navbar>
    </Container>
  );
}

export default App;
